Każda nazwa interfejsu musi zaczynać się od litery I, typ odpowiedzi generowany jest tylko jako data, bez generowania pól code, msg itp.

```ts
import request from "@/utils/request";
/** Opis interfejsu - parametry */
export interface IApiDescParams {
  /** Liczba elementów na stronie */
  pageSize: number;
}
/** Opis interfejsu - odpowiedź */
export interface IApiDescData {}
/** Opis interfejsu - interfejs */
export const methodApiDescApi = (params: IApiDescParams) => {
  return request.get<IApiDescData>("/xxx", params);
};
```
